import { Box, Button, styled, Typography, Grid, List, ListItem, ListItemText } from "@mui/material";
import React from "react";

import buyIcon from "../media/buy_icon.png";
import sellIcon from "../media/sell_icon.png";
import rentIcon from "../media/rent_icon.png";

import ArrowRightAltIcon from "@mui/icons-material/ArrowRightAlt";
import CustomButton from "./CustomButton";

/* Iconos */
import AccountBalanceIcon from '@mui/icons-material/AccountBalance';

const Guide = () => {
  const CustomBox = styled(Box)(({ theme }) => ({
    width: "30%",
    [theme.breakpoints.down("md")]: {
      width: "85%"
    }
  }));

  const GuidesBox = styled(Box)(({ theme }) => ({
    display: "flex",
    justifyContent: "space-around",
    width: "70%",
    marginTop: theme.spacing(5),
    marginBottom: theme.spacing(5),
    [theme.breakpoints.down("md")]: {
      width: "100%",
    },
    [theme.breakpoints.down("sm")]: {
      marginBottom: "0",
      flexDirection: "column",
    },
  }));

  const GuideBox = styled(Box)(({ theme }) => ({
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    marginTop: theme.spacing(5),
    [theme.breakpoints.down("sm")]: {
      margin: theme.spacing(2, 0, 2, 0),
    },
  }));

  return (
    <Grid alignItems="center" spacing={2} sx={{mt: 5, px:5}} container>
      <Grid xs={12} md={4} alignItems="center">
        <Box sx={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
          <AccountBalanceIcon sx={{fontSize: 40}}/>
          <Typography 
            textAlign="center"
            variant="h6" 
            sx={{my:1, color: "#3B3C45", fontWeight: "bold" }}
          >
            Servicios contables y fiscales
          </Typography>
          <List>
            <ListItem>
              <ListItemText 
                primary="Contabilidad general de personas fÃ­sicas y morales"
                sx={{ color: "#3B3C45" }}
              />
            </ListItem>
          </List>
        </Box>
      </Grid>
      <Grid xs={12} md={4} alignItems="center">
      </Grid>
      <Grid xs={12} md={4} alignItems="center">
      </Grid>
    </Grid>
  )
};

export default Guide;
